import React, { useState, useEffect } from 'react';
import {
    Button,InputGroup, InputGroupAddon, InputGroupText, Input,
  } from 'reactstrap';
import Navig from './Navig';

export default function Home() {
    useEffect(()=>{
        if('geolocation' in navigator) {
            console.log('geolocation is available');
          } else {
            console.log('geolocation IS NOT available');
          }
          navigator.geolocation.getCurrentPosition((position) => {
            console.log(position.coords.latitude, position.coords.longitude);
          });
        const API = async()=> {
            fetch("https://forward-reverse-geocoding.p.rapidapi.com/v1/reverse?format=json&lon=-87.6244212&lat=41.8755616&accept-language=en&polygon_threshold=0.0", {
            "method": "GET",
            "headers": {
                "x-rapidapi-key": "eb71094070msh0f063c4534649bcp14ec8djsn9f81e1fd2c7b",
                "x-rapidapi-host": "forward-reverse-geocoding.p.rapidapi.com"
            }
            })
            .then(rawResponse => {
                console.log('RAW RESPONSE',rawResponse);
                var response = rawResponse.json();
                console.log('RESPONSE',response);
                console.log('CITY',response.address.city);
            })
            .catch(err => {
                console.error(err);
            });
        }
        API();
    },[]);
    return (
        <div>
            <Navig/>
        </div>
    )
}
